mapper.select:

select 

from RMBTCHMTR
where RMBTCHMTR_SDN = #{rmbtchmtrSdn,jdbcType=CHAR}
  and RMBTCHMTR_REMDATE = #{rmbtchmtrRemdate,jdbcType=CHAR}
  and RMBTCHMTR_TIMES = #{rmbtchmtrTimes,jdbcType=VARCHAR}

mapper.delete:

delete from RMBTCHMTR
where RMBTCHMTR_SDN = #{rmbtchmtrSdn,jdbcType=CHAR}
  and RMBTCHMTR_REMDATE = #{rmbtchmtrRemdate,jdbcType=CHAR}
  and RMBTCHMTR_TIMES = #{rmbtchmtrTimes,jdbcType=VARCHAR}
